                                                </tr>
                                                */}
                                            );
                                    })}                               
                            </tbody>
                            </table>
                        </div>

                        <div className="modal-body">
                            <h5 className="modal-title">Edit Quantity</h5>
                            <div className="input-group col-md-4 m-1">
                                        <input className="form-control py-2 border-right-0 border" type="search" placeholder="search" onChange={e=>{setSearch(e.target.value)}} id="example-search-input"/>
                                        <span className="input-group-append">
                                            <button className="btn btn-outline-secondary border-left-0 border" type="button">
                                                <i className="fa fa-search"></i>
                                            </button>
                                        </span>
                            </div> 
                            <table className="table">
                                <thead>
                                <tr>
                                    <th>Prod Name</th>
                                    <th>Quantity</th>
                                    <th>Unit Price</th>
                                    <th>Subtotal</th>
                                </tr>
                                </thead>
                                <tbody>
                                <tr>
                                    <td>Coca-cola 2L</td>
                                    <td>10</td>
                                    <td>7.50</td>
                                    <td>75.00</td>
                                </tr>                                    
                                </tbody>
                            </table>
                        </div>

                        <div className="modal-footer">
                            <div className="container">
                                <button type="button" className="btn btn-success m-1" data-dismiss="modal">Ok</button>
                                <button type="button" className="btn btn-secondary m-1" data-dismiss="modal">Close</button>
                            </div>

                        </div>

                    </div>
                    </div>
                </div>

            </div>


        </>

    );

};

export default OrderDetail;
